import React, {Component} from "react"

class LinkCard extends Component{

    render() {
        return(
            <div className="cardContainer" style={style.cardContainer}>

                <div className="bottomColor" style={style.headerC}>
                     <h1 className={"linkHeader"}>

                     </h1>
                </div>
            </div>
        );
    }
}

const style = {
    cardContainer: {
        textAlign: "center",
        border: "1px solid",
        position: "relative",
        float: "right",
        width: "100%",
        height: "25%",
        margin: "8%",
    },
    headerC: {
        position: "absolute",
        width: "100%",
        height: "30%",
        marginBottom: "0px",
    }
};

export default LinkCard;
